import Item from './Item'


const ItemList = ({productos}) => {
        return (
            <div>
                <div id='Productos' style={{}}>
                {productos,map((dato)=>
                <div>
                    Id,precio,title,descripcion,img}
                    <Item/>
                </div>   
                )}   
                </div>


            </div>
        )
} 

export default ItemList;
